const handleDelete = (name) => {
    window.confirm(`Delete ${name} ?`)
}

const Names = ({names}) => {
    return (
        <div>
            {names.map(name => 
            <p key={name.name}>
                {name.name} {name.number}
                <button onClick={handleDelete(name.name)}>delete</button>
            </p>)}
            
        </div>
    )
}

export default Names
